","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves initial data","location":{"start":{"column":6,"line":20}}},{"id":"1","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves data from API","location":{"start":{"column":6,"line":56}}},{"id":"2","name":"utils/currentUser tests useCurrentUser tests useCurrentUser when API unreachable","location":{"start":{"column":6,"line":80}}},{"id":"3","name":"utils/currentUser tests useCurrentUser tests useCurrentUser handles missing roles correctly","location":{"start":{"column":6,"line":108}}},{"id":"4","name":"utils/currentUser tests useLogout tests useLogout","location":{"start":{"column":6,"line":138}}},{"id":"5","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined","location":{"start":{"column":6,"line":172}}},{"id":"6","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined","location":{"start":{"column":6,"line":184}}},{"id":"7","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_USER\") returns correct values when currentUser properly defined","location":{"start":{"column":6,"line":202}}},{"id":"8","name":"utils/currentUser tests hasRole tests hasRole returns correct values when data is in currentUser","location":{"start":{"column":6,"line":220}}},{"id":"9","name":"utils/currentUser tests hasRole tests hasRole falls back correctly with various data missing","location":{"start":{"column":6,"line":226}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useCurrentUser, useLogout, hasRole } from \"main/utils/currentUser\";\nimport { renderHook, waitFor, act } from \"@testing-library/react\";\nimport {\n  apiCurrentUserFixtures,\n  currentUserFixtures,\n} from \"fixtures/currentUserFixtures\";\nimport mockConsole from \"jest-mock-console\";\nimport { useNavigate } from \"react-router-dom\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\njest.mock(\"react-router-dom\");\nconst { MemoryRouter } = jest.requireActual(\"react-router-dom\");\n\ndescribe(\"utils/currentUser tests\", () => {\n  describe(\"useCurrentUser tests\", () => {\n    test(\"useCurrentUser retrieves initial data\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").timeoutOnce();\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const restoreConsole = mockConsole();\n\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n      await waitFor(() => result.current.isSuccess);\n\n      expect(result.current.data).toEqual({\n        loggedIn: false,\n        root: null,\n        initialData: true,\n      });\n\n      const queryState = queryClient.getQueryState(\"current user\");\n      expect(queryState).toBeDefined();\n\n      queryClient.clear();\n\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n    });\n\n    test(\"useCurrentUser retrieves data from API\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n\n      await waitFor(() => result.current.isFetched);\n\n      expect(result.current.data).toEqual(currentUserFixtures.userOnly);\n      queryClient.clear();\n    });\n\n    test(\"useCurrentUser when API unreachable\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").reply(404);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n\n      expect(result.current.data).toEqual({\n        initialData: true,\n        loggedIn: false,\n        root: null,\n      });\n      queryClient.clear();\n    });\n\n    test(\"useCurrentUser handles missing roles correctly\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const apiResult = apiCurrentUserFixtures.missingRolesToTestErrorHandling;\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").reply(200, apiResult);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error getting roles: /);\n      restoreConsole();\n\n      let expectedResult = {\n        loggedIn: true,\n        root: { ...apiResult, rolesList: [\"ERROR_GETTING_ROLES\"] },\n      };\n      expect(result.current.data).toEqual(expectedResult);\n      queryClient.clear();\n    });\n  });\n  describe(\"useLogout tests\", () => {\n    test(\"useLogout\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>{children}<"+"/MemoryRouter>\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onPost(\"/logout\").reply(200);\n\n      const navigateSpy = jest.fn();\n      useNavigate.mockImplementation(() => navigateSpy);\n\n      const resetQueriesSpy = jest.spyOn(queryClient, \"resetQueries\");\n\n      const { result } = renderHook(() => useLogout(), { wrapper });\n\n      act(() => {\n        expect(useNavigate).toHaveBeenCalled();\n        result.current.mutate();\n      });\n      await waitFor(() => expect(navigateSpy).toHaveBeenCalledWith(\"/\"));\n\n      await waitFor(() =>\n        expect(resetQueriesSpy).toHaveBeenCalledWith(\"current user\", {\n          exact: true,\n        }),\n      );\n\n      queryClient.clear();\n    });\n  });\n  describe(\"hasRole tests\", () => {\n    test('hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined', async () => {\n      expect(hasRole(null, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({}, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: null }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true, root: null }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true, root: {} }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: null } }, \"ROLE_ADMIN\"),\n      ).toBeFalsy();\n    });\n\n    test('hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined', async () => {\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: [] } }, \"ROLE_ADMIN\"),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeTruthy();\n    });\n\n    test('hasRole(x,\"ROLE_USER\") returns correct values when currentUser properly defined', async () => {\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: [] } }, \"ROLE_USER\"),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\"] } },\n          \"ROLE_USER\",\n        ),\n      ).toBeTruthy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } },\n          \"ROLE_USER\",\n        ),\n      ).toBeTruthy();\n    });\n\n    test(\"hasRole returns correct values when data is in currentUser\", async () => {\n      const currentUser = { data: { root: { rolesList: [\"ROLE_USER\"] } } };\n      expect(hasRole(currentUser, \"ROLE_USER\")).toBeTruthy();\n      expect(hasRole(currentUser, \"ROLE_ADMIN\")).toBeFalsy();\n    });\n\n    test(\"hasRole falls back correctly with various data missing\", async () => {\n      expect(hasRole(null, \"ROLE_USER\")).toBeFalsy();\n      expect(hasRole({}, \"ROLE_USER\")).toBeFalsy();\n      expect(hasRole({ currentUser: null }, \"ROLE_USER\")).toBeFalsy();\n      expect(hasRole({ currentUser: { data: null } }, \"ROLE_USER\")).toBeFalsy();\n      expect(\n        hasRole({ currentUser: { data: { root: null } } }, \"ROLE_USER\"),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { currentUser: { data: { root: { rolesList: null } } } },\n          \"ROLE_USER\",\n        ),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { currentUser: { data: { root: { rolesList: [] } } } },\n          \"ROLE_USER\",\n        ),\n      ).toBeFalsy();\n    });\n  });\n});\n"},"src/tests/components/Restaurants/RestaurantTable.test.js":{"tests":[{"id":"10","name":"RestaurantTable tests renders empty table correctly","location":{"start":{"column":4,"line":24}}},{"id":"11","name":"RestaurantTable tests Has the expected column headers, content and buttons for admin user","location":{"start":{"column":4,"line":51}}},{"id":"12","name":"RestaurantTable tests Has the expected column headers, content for ordinary user","location":{"start":{"column":4,"line":105}}},{"id":"13","name":"RestaurantTable tests Edit button navigates to the edit page","location":{"start":{"column":4,"line":150}}},{"id":"14","name":"RestaurantTable tests Delete button calls delete callback","location":{"start":{"column":4,"line":188}}}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { restaurantFixtures } from \"fixtures/restaurantFixtures\";\nimport RestaurantTable from \"main/components/Restaurants/RestaurantTable\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"RestaurantTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  const expectedHeaders = [\"id\", \"Name\", \"Description\"];\n  const expectedFields = [\"id\", \"name\", \"description\"];\n  const testId = \"RestaurantTable\";\n\n  test(\"renders empty table correctly\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable restaurants={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const fieldElement = screen.queryByTestId(\n        `${testId}-cell-row-0-col-${field}`,\n      );\n      expect(fieldElement).not.toBeInTheDocument();\n    });\n  });\n\n  test(\"Has the expected column headers, content and buttons for admin user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable\n            restaurants={restaurantFixtures.threeRestaurants}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-name`),\n    ).toHaveTextContent(\"Cristino's Bakery\");\n\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"3\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-name`),\n    ).toHaveTextContent(\"Freebirds\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n    expect(editButton).toHaveClass(\"btn-primary\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"Has the expected column headers, content for ordinary user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.userOnly;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable\n            restaurants={restaurantFixtures.threeRestaurants}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-name`),\n    ).toHaveTextContent(\"Cristino's Bakery\");\n\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"3\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-name`),\n    ).toHaveTextContent(\"Freebirds\");\n\n    expect(screen.queryByText(\"Delete\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"Edit\")).not.toBeInTheDocument();\n  });\n\n  test(\"Edit button navigates to the edit page\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable\n            restaurants={restaurantFixtures.threeRestaurants}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert - check that the expected content is rendered\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-id`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-name`),\n    ).toHaveTextContent(\"Cristino's Bakery\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n\n    // act - click the edit button\n    fireEvent.click(editButton);\n\n    // assert - check that the navigate function was called with the expected path\n    await waitFor(() =>\n      expect(mockedNavigate).toHaveBeenCalledWith(\"/restaurants/edit/2\"),\n    );\n  });\n\n  test(\"Delete button calls delete callback\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    const axiosMock = new AxiosMockAdapter(axios);\n    axiosMock\n      .onDelete(\"/api/restaurants\")\n      .reply(200, { message: \"Restaurant deleted\" });\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable\n            restaurants={restaurantFixtures.threeRestaurants}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert - check that the expected content is rendered\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-id`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-name`),\n    ).toHaveTextContent(\"Cristino's Bakery\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    // act - click the delete button\n    fireEvent.click(deleteButton);\n\n    // assert - check that the delete endpoint was called\n\n    await waitFor(() => expect(axiosMock.history.delete.length).toBe(1));\n    expect(axiosMock.history.delete[0].params).toEqual({ id: 2 });\n  });\n});\n"},"src/tests/components/Nav/AppNavbar.test.js":{"tests":[{"id":"15","name":"AppNavbar tests renders correctly for regular logged in user","location":{"start":{"column":4,"line":12}}},{"id":"16","name":"AppNavbar tests renders correctly for admin user","location":{"start":{"column":4,"line":27}}},{"id":"17","name":"AppNavbar tests renders H2Console and Swagger links correctly","location":{"start":{"column":4,"line":44}}},{"id":"18","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://localhost:3000","location":{"start":{"column":4,"line":67}}},{"id":"19","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://127.0.0.1:3000","location":{"start":{"column":4,"line":96}}},{"id":"20","name":"AppNavbar tests does NOT render the AppNavbarLocalhost when on localhost:8080","location":{"start":{"column":4,"line":119}}},{"id":"21","name":"AppNavbar tests renders the ucsbdates link correctly","location":{"start":{"column":4,"line":143}}},{"id":"22","name":"AppNavbar tests renders the restaurants link correctly","location":{"start":{"column":4,"line":167}}},{"id":"23","name":"AppNavbar tests Restaurant and UCSBDates links do NOT show when not logged in","location":{"start":{"column":4,"line":191}}},{"id":"24","name":"AppNavbar tests when oauthlogin undefined, default value is used","location":{"start":{"column":4,"line":212}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\n\nimport AppNavbar from \"main/components/Nav/AppNavbar\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"AppNavbar tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders correctly for regular logged in user\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const doLogin = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Welcome, pconrad.cis@gmail.com\");\n  });\n\n  test(\"renders correctly for admin user\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const doLogin = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Welcome, phtcon@ucsb.edu\");\n    const adminMenu = screen.getByTestId(\"appnavbar-admin-dropdown\");\n    expect(adminMenu).toBeInTheDocument();\n  });\n\n  test(\"renders H2Console and Swagger links correctly\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const systemInfo = systemInfoFixtures.showingBoth;\n\n    const doLogin = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"H2Console\");\n    const swaggerMenu = screen.getByText(\"Swagger\");\n    expect(swaggerMenu).toBeInTheDocument();\n  });\n\n  test(\"renders the AppNavbarLocalhost when on http://localhost:3000\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n    const doLogin = jest.fn();\n\n    delete window.location;\n    window.location = new URL(\"http://localhost:3000\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByTestId(\"AppNavbarLocalhost\");\n    expect(screen.getByTestId(\"AppNavbarLocalhost-message1\").textContent).toBe(\n      \"Running on http://localhost:3000/ with no backend.\",\n    );\n    expect(screen.getByTestId(\"AppNavbarLocalhost-message2\").textContent).toBe(\n      \"You probably want http://localhost:8080 instead.\",\n    );\n  });\n\n  test(\"renders the AppNavbarLocalhost when on http://127.0.0.1:3000\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n    const doLogin = jest.fn();\n\n    delete window.location;\n    window.location = new URL(\"http://127.0.0.1:3000\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByTestId(\"AppNavbarLocalhost\");\n  });\n\n  test(\"does NOT render the AppNavbarLocalhost when on localhost:8080\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n    const doLogin = jest.fn();\n\n    delete window.location;\n    window.location = new URL(\"http://localhost:8080\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByTestId(\"AppNavbar\");\n    expect(screen.queryByTestId(/AppNavbarLocalhost/i)).toBeNull();\n  });\n\n  test(\"renders the ucsbdates link correctly\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n\n    const doLogin = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"UCSB Dates\");\n    const link = screen.getByText(\"UCSB Dates\");\n    expect(link).toBeInTheDocument();\n    expect(link.getAttribute(\"href\")).toBe(\"/ucsbdates\");\n  });\n\n  test(\"renders the restaurants link correctly\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n\n    const doLogin = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Restaurants\");\n    const link = screen.getByText(\"Restaurants\");\n    expect(link).toBeInTheDocument();\n    expect(link.getAttribute(\"href\")).toBe(\"/restaurants\");\n  });\n\n  test(\"Restaurant and UCSBDates links do NOT show when not logged in\", async () => {\n    const currentUser = null;\n    const systemInfo = systemInfoFixtures.showingBoth;\n    const doLogin = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.queryByText(\"Restaurants\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"UCSBDates\")).not.toBeInTheDocument();\n  });\n\n  test(\"when oauthlogin undefined, default value is used\", async () => {\n    const currentUser = currentUserFixtures.notLoggedIn;\n    const systemInfo = systemInfoFixtures.oauthLoginUndefined;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Log In\");\n    expect(screen.getByText(\"Log In\")).toHaveAttribute(\n      \"href\",\n      \"/oauth2/authorization/google\",\n    );\n  });\n});\n"},"src/tests/utils/useBackend.test.js":{"tests":[{"id":"25","name":"utils/useBackend tests utils/useBackend useBackend tests useBackend handles 404 error correctly","location":{"start":{"column":6,"line":31}}},{"id":"26","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles success correctly","location":{"start":{"column":6,"line":72}}},{"id":"27","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles error correctly","location":{"start":{"column":6,"line":135}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { renderHook, waitFor, act } from \"@testing-library/react\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { useBackend, useBackendMutation } from \"main/utils/useBackend\";\n\njest.mock(\"react-router-dom\");\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"utils/useBackend tests\", () => {\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  afterEach(() => {\n    console.error.mockRestore();\n  });\n\n  describe(\"utils/useBackend useBackend tests\", () => {\n    test(\"useBackend handles 404 error correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n\n      axiosMock.onGet(\"/api/admin/users\").reply(404, {});\n\n      const { result } = renderHook(\n        () =>\n          useBackend(\n            [\"/api/admin/users\"],\n            { method: \"GET\", url: \"/api/admin/users\" },\n            [\"initialData\"],\n          ),\n        { wrapper },\n      );\n\n      await waitFor(() => result.current.isError);\n\n      expect(result.current.data).toEqual([\"initialData\"]);\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(\n        \"Error communicating with backend via GET on /api/admin/users\",\n      );\n    });\n  });\n  describe(\"utils/useBackend useBackendMutation tests\", () => {\n    test(\"useBackendMutation handles success correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(202, {\n        id: 17,\n        quarterYYYYQ: \"20221\",\n        name: \"Groundhog Day\",\n        localDateTime: \"2022-02-02T12:00\",\n      });\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () =>\n          useBackendMutation(objectToAxiosParams, { onSuccess }, [\n            \"/api/ucsbdates/all\",\n          ]),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n      act(() =>\n        mutation.mutate({\n          quarterYYYYQ: \"20221\",\n          name: \"Groundhog Day\",\n          localDateTime: \"2022-02-02T12:00\",\n        }),\n      );\n\n      await waitFor(() => expect(onSuccess).toHaveBeenCalled());\n      expect(mockToast).toHaveBeenCalledWith(\n        \"New ucsbDate Created - id: 17 name: Groundhog Day\",\n      );\n    });\n    test(\"useBackendMutation handles error correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(404);\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () => useBackendMutation(objectToAxiosParams, { onSuccess }),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n\n      mutation.mutate(\n        {\n          quarterYYYYQ: \"20221\",\n          name: \"Bastille Day\",\n          localDateTime: \"2022-06-14T12:00\",\n        },\n        {\n          onError: (e) =>\n            console.error(\n              \"onError from mutation.mutate called!\",\n              String(e).substring(0, 199),\n            ),\n        },\n      );\n\n      await waitFor(() => expect(mockToast).toHaveBeenCalled());\n      expect(mockToast).toHaveBeenCalledTimes(2);\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Axios Error: Error: Request failed with status code 404\",\n      );\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Error: Request failed with status code 404\",\n      );\n\n      expect(console.error).toHaveBeenCalledTimes(3);\n      const errorMessage0 = console.error.mock.calls[0][0];\n      expect(errorMessage0).toMatch(/Axios Error:/);\n      const errorMessage1 = console.error.mock.calls[1][0];\n      expect(errorMessage1.message).toMatch(\n        /Request failed with status code 404/,\n      );\n      const errorMessage2 = console.error.mock.calls[2][0];\n      expect(errorMessage2).toMatch(/onError from mutation.mutate called!/);\n    });\n  });\n});\n"},"src/tests/pages/UCSBDates/UCSBDatesEditPage.test.js":{"tests":[{"id":"28","name":"UCSBDatesEditPage tests when the backend doesn't return data renders header but table is not present","location":{"start":{"column":6,"line":56}}},{"id":"29","name":"UCSBDatesEditPage tests tests where backend is working normally renders without crashing","location":{"start":{"column":6,"line":101}}},{"id":"30","name":"UCSBDatesEditPage tests tests where backend is working normally Is populated with the data provided","location":{"start":{"column":6,"line":113}}},{"id":"31","name":"UCSBDatesEditPage tests tests where backend is working normally Changes when you click Update","location":{"start":{"column":6,"line":139}}}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport UCSBDatesEditPage from \"main/pages/UCSBDates/UCSBDatesEditPage\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport mockConsole from \"jest-mock-console\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => {\n  const originalModule = jest.requireActual(\"react-router-dom\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      id: 17,\n    }),\n    Navigate: (x) => {\n      mockNavigate(x);\n      return null;\n    },\n  };\n});\n\ndescribe(\"UCSBDatesEditPage tests\", () => {\n  describe(\"when the backend doesn't return data\", () => {\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n      axiosMock.reset();\n      axiosMock.resetHistory();\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n      axiosMock.onGet(\"/api/ucsbdates\", { params: { id: 17 } }).timeout();\n    });\n\n    const queryClient = new QueryClient();\n    test(\"renders header but table is not present\", async () => {\n      const restoreConsole = mockConsole();\n\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"UCSBDatesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n      await screen.findByText(\"Edit UCSBDate\");\n      expect(\n        screen.queryByTestId(\"UCSBDateForm-quarterYYYYQ\"),\n      ).not.toBeInTheDocument();\n      restoreConsole();\n    });\n  });\n\n  describe(\"tests where backend is working normally\", () => {\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n      axiosMock.reset();\n      axiosMock.resetHistory();\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n      axiosMock.onGet(\"/api/ucsbdates\", { params: { id: 17 } }).reply(200, {\n        id: 17,\n        quarterYYYYQ: \"20221\",\n        name: \"Pi Day\",\n        localDateTime: \"2022-03-14T15:00\",\n      });\n      axiosMock.onPut(\"/api/ucsbdates\").reply(200, {\n        id: \"17\",\n        quarterYYYYQ: \"20224\",\n        name: \"Christmas Morning\",\n        localDateTime: \"2022-12-25T08:00\",\n      });\n    });\n\n    const queryClient = new QueryClient();\n    test(\"renders without crashing\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"UCSBDatesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n\n      await screen.findByTestId(\"UCSBDateForm-quarterYYYYQ\");\n    });\n\n    test(\"Is populated with the data provided\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"UCSBDatesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n\n      await screen.findByTestId(\"UCSBDateForm-quarterYYYYQ\");\n\n      const idField = screen.getByTestId(\"UCSBDateForm-id\");\n      const quarterYYYYQField = screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\");\n      const nameField = screen.getByTestId(\"UCSBDateForm-name\");\n      const localDateTimeField = screen.getByTestId(\n        \"UCSBDateForm-localDateTime\",\n      );\n      const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n      expect(idField).toHaveValue(\"17\");\n      expect(quarterYYYYQField).toHaveValue(\"20221\");\n      expect(nameField).toHaveValue(\"Pi Day\");\n      expect(localDateTimeField).toHaveValue(\"2022-03-14T15:00\");\n      expect(submitButton).toBeInTheDocument();\n    });\n\n    test(\"Changes when you click Update\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"UCSBDatesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n\n      await screen.findByTestId(\"UCSBDateForm-quarterYYYYQ\");\n\n      const idField = screen.getByTestId(\"UCSBDateForm-id\");\n      const quarterYYYYQField = screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\");\n      const nameField = screen.getByTestId(\"UCSBDateForm-name\");\n      const localDateTimeField = screen.getByTestId(\n        \"UCSBDateForm-localDateTime\",\n      );\n      const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n      expect(idField).toHaveValue(\"17\");\n      expect(quarterYYYYQField).toHaveValue(\"20221\");\n      expect(nameField).toHaveValue(\"Pi Day\");\n      expect(localDateTimeField).toHaveValue(\"2022-03-14T15:00\");\n\n      expect(submitButton).toBeInTheDocument();\n\n      fireEvent.change(quarterYYYYQField, { target: { value: \"20224\" } });\n      fireEvent.change(nameField, { target: { value: \"Christmas Morning\" } });\n      fireEvent.change(localDateTimeField, {\n        target: { value: \"2022-12-25T08:00\" },\n      });\n\n      fireEvent.click(submitButton);\n\n      await waitFor(() => expect(mockToast).toBeCalled());\n      expect(mockToast).toBeCalledWith(\n        \"UCSBDate Updated - id: 17 name: Christmas Morning\",\n      );\n      expect(mockNavigate).toBeCalledWith({ to: \"/ucsbdates\" });\n\n      expect(axiosMock.history.put.length).toBe(1); // times called\n      expect(axiosMock.history.put[0].params).toEqual({ id: 17 });\n      expect(axiosMock.history.put[0].data).toBe(\n        JSON.stringify({\n          quarterYYYYQ: \"20224\",\n          name: \"Christmas Morning\",\n          localDateTime: \"2022-12-25T08:00\",\n        }),\n      ); // posted object\n    });\n  });\n});\n"},"src/tests/pages/Restaurants/RestaurantEditPage.test.js":{"tests":[{"id":"32","name":"RestaurantEditPage tests when the backend doesn't return data renders header but table is not present","location":{"start":{"c
